DELIMITER $$
--
-- Funções
--
DROP FUNCTION IF EXISTS `normalizarCnae`$$
CREATE DEFINER=`semus`@`%` FUNCTION `normalizarCnae` (`cnae` VARCHAR(255)) RETURNS VARCHAR(255) CHARSET utf8mb4 COLLATE utf8mb4_general_ci NO SQL BEGIN
    DECLARE parte_principal VARCHAR(255);
    DECLARE parte_secundaria VARCHAR(255);
    
    -- Remove caracteres não numéricos e barras extras
    SET cnae = REGEXP_REPLACE(cnae, '[^0-9\/]', '');
    
    -- Divide em partes principal e secundária
    SET parte_principal = SUBSTRING_INDEX(cnae, '/', 1);
    SET parte_secundaria = SUBSTRING_INDEX(cnae, '/', -1);
    
    -- Remove zeros à esquerda
    SET parte_principal = TRIM(LEADING '0' FROM parte_principal);
    
    -- Trata parte secundária (se existir)
    IF parte_secundaria != parte_principal THEN
        SET parte_secundaria = TRIM(LEADING '0' FROM parte_secundaria);
        RETURN CONCAT(parte_principal, '/', parte_secundaria);
    ELSE
        RETURN parte_principal;
    END IF;
END$$

